import React from 'react';

import Theme from '../containers/Theme/Theme';
import MountainVideo from '../assets/mountain.mp4';

function Mountain() {
  return (
    <Theme url="/assets/mountain.mp3" theme="mountain" bg={MountainVideo} />
  );
}

export default Mountain;

